Nine Dead (2010) NTSC

Verenigde Staten
Mystery / Thriller
98 minuten

geregisseerd door Chris Shadley
met Melissa Joan Hart, William Lee Scott en John Terry

Negen mensen worden met uiterste precisie gekidnapped door een gemaskerde man. Ze worden allen geboeid aan een paal in een bunker. De man dreigt iedere 10 minuten iemand te doden als ze hem hem niet binnen 10 minuten kunnen vertellen waarom ze daar zijn. In grote angst om vermoord te worden biechten ze elkaar hun grootste zondes op.




